import React, { useState, useEffect } from 'react';
import '../Styles/Popup.css';

function Popup(props) {

  return isOpen ? (
    <div className="popup">
      <div className='popup-inner'>
        <button className="close-btn" onClick={setIsOpen(false)}>close</button>
        {props.children}
      </div>
    </div>
  ) : null;
}

export default Popup;
